(11, 1, '2022-12-22 18:54:52', '2022-12-22 18:54:52', '<!-- wp:paragraph -->\n<p>Unders철kningen syftade till att kartl채gga bevarandestatus och m책leriteknik. Arbetet inkluderade 채ven kartl채ggning av status hos bevarade m책lningar 철ver valv.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Liksom vid v책ra tidigare unders철kningar och konserveringsarbeten av romanska m책lningar bidrog Nationalmuseet i Danmark med kemiska och tekniska analyser av originalmaterialet.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Analysresultaten gav tillsammans med ett mycket omfattande arkivmaterial bilden av en exceptionell situation. M책lningarna har utsatts f철r flera f철r철dande konserverings책tg채rder bl.a. genom mycket omfattande impregnering med Bariumklorid p책 1940-talet. Syftet med konserveringen var att det ol철sliga och allm채nt ofarliga saltet Bariumsulfat skulle bildas. Resultatet blev i st채llet att puts- och ytskikt nu 채r helt kontaminerat av det mycket toxiska saltet Bariumnitrat. I riskkalkylen f철r 1940-talets konservering inkluderades inte det nitrat som 채r rikligt f철rekommande i den sv책rt f철rorenade Finjasj철n.</p>\n<!-- /wp:paragraph -->', 'Finja kyrka', 'Under 2014 och 2015 utf철rdes en omfattande konserveringsteknisk f철runders철kning av de ber철mda och i h철g grad autentiska romanska m책lningarna i Finja kyrka. ', 'publish', 'open', 'open', '', 'finja-kyrka', '', '', '2022-12-22 19:03:15', '2022-12-22 19:03:15', '', 0, 'http://examensarbete.test/?p=11', 0, 'post', '', 0),
