(13, 1, '2022-12-22 18:54:52', '2022-12-22 18:54:52', '<!-- wp:image {\"id\":12,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://examensarbete.test/wp-content/uploads/2022/12/finja_kyrka.jpg\" alt=\"V채ggm책lningar i Finja kyrka\" class=\"wp-image-12\"/><figcaption class=\"wp-element-caption\">Romanska m책lningar i Finja Kyrka</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Under 2014 och 2015 utf철rdes en omfattande konserveringsteknisk f철runders철kning av de ber철mda och i h철g grad autentiska romanska m책lningarna i Finja kyrka. Unders철kningen syftade till att kartl채gga bevarandestatus och m책leriteknik. Arbetet inkluderade 채ven kartl채ggning av status hos bevarade m책lningar 철ver valv.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Liksom vid v책ra tidigare unders철kningar och konserveringsarbeten av romanska m책lningar bidrog Nationalmuseet i Danmark med kemiska och tekniska analyser av originalmaterialet.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Analysresultaten gav tillsammans med ett mycket omfattande arkivmaterial bilden av en exceptionell situation. M책lningarna har utsatts f철r flera f철r철dande konserverings책tg채rder bl.a. genom mycket omfattande impregnering med Bariumklorid p책 1940-talet. Syftet med konserveringen var att det ol철sliga och allm채nt ofarliga saltet Bariumsulfat skulle bildas. Resultatet blev i st채llet att puts- och ytskikt nu 채r helt kontaminerat av det mycket toxiska saltet Bariumnitrat. I riskkalkylen f철r 1940-talets konservering inkluderades inte det nitrat som 채r rikligt f철rekommande i den sv책rt f철rorenade Finjasj철n.</p>\n<!-- /wp:paragraph -->', 'Finja kyrka', '', 'inherit', 'closed', 'closed', '', '11-revision-v1', '', '', '2022-12-22 18:54:52', '2022-12-22 18:54:52', '', 11, 'http://examensarbete.test/?p=13', 0, 'revision', '', 0),
