(20, 1, '2022-12-22 19:15:42', '2022-12-22 19:15:42', '<!-- wp:paragraph -->\n<p>Vid Konserveringsarbetet i Lyngsj철 identifierades kriterier f철r att freskal teknik bl.a. i form av mycket tydliga dagsverks- och st채llningsskiften.<br>I Lyngsj철 och Gual철v liksom i V채 och Finja finns riklig anv채ndning av 채kta ultramarin  lapis lazuli. Genom f철rbindelser med det bysantiska riket 채r anv채ndningen av lapiz lasuli i det tidigmedeltida Sk책ne och Danmark unik vid j채mf철relse med 철vriga Europa.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":21,\"sizeSlug\":\"medium\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-medium\"><img src=\"http://examensarbete.test/wp-content/uploads/2022/12/korets-vagg-och-triumfbagen-300x199.jpeg\" alt=\"Korets v채gg och triumfb책gen\" class=\"wp-image-21\"/><figcaption class=\"wp-element-caption\">Lyngsj철 kyrka. Korets v채stv채gg och triumfb책gen.</figcaption></figure>\n<!-- /wp:image -->', 'Lyngsj철 kyrka och Gual철vs kyrka', 'Konservering av romanska m책lningar inkluderar ett par av de fr채msta och b채st bevarade i Sverige n채mligen Lyngsj철 och Gual철v b책da fr책n perioden 1125-50. ', 'publish', 'open', 'open', '', 'lyngsjo-kyrka-och-gualovs-kyrka', '', '', '2022-12-22 19:15:42', '2022-12-22 19:15:42', '', 0, 'http://examensarbete.test/?p=20', 0, 'post', '', 0),
